import Head from "next/head";
import Container from "../components/Container";

const Index = () => {  
    return (    
        <div>   
             <Container>

            <Head>
                <title>Next.js Project - Home</title>
            </Head>
                <h1>Index</h1>

            </Container>
        </div>
        )
    }

    


export default Index;
